// Blake

import React, { useState, useEffect } from 'react';

export default function TransactionHistory({ customerAccountId }) {
    const [accountId, setAccountId] = useState(customerAccountId || '');
    const [transactions, setTransactions] = useState([]);
    const [message, setMessage] = useState('');

    useEffect(() => {
        if (customerAccountId) {
            fetchTransactions(customerAccountId);
        }
    }, [customerAccountId]);

    const handleInputChange = (e) => setAccountId(e.target.value);

    const handleSubmit = (e) => {
        e.preventDefault();
        if (!accountId) {
            setMessage('Please enter an account ID');
            return;
        }
        fetchTransactions(accountId);
    };

    const fetchTransactions = async (id) => {
        try {
            // Dummy data for testing
            const dummyTransactions = [
                { id: 1, date: '2024-07-31', type: 'Deposit', amount: 500 },
                { id: 2, date: '2024-07-30', type: 'Withdrawal', amount: 200 },
            ];
            setTransactions(dummyTransactions);
            setMessage('');

            // Uncomment below to use actual API endpoint
            // const response = await fetch(`http://localhost:4000/accounts/${id}/transactions`);
            // if (response.ok) {
            //     const data = await response.json();
            //     setTransactions(data);
            //     setMessage('');
            // } else {
            //     setTransactions([]);
            //     setMessage('No transactions found for this account');
            // }
        } catch (error) {
            setTransactions([]);
            setMessage('Error fetching transactions');
        }
    };

    return (
        <div style={styles.container}>
            <h2>Transaction History</h2>
            {!customerAccountId && (
                <form onSubmit={handleSubmit} style={styles.form}>
                    <div style={styles.formGroup}>
                        <label htmlFor="accountId">Account ID:</label>
                        <input
                            type="text"
                            id="accountId"
                            value={accountId}
                            onChange={handleInputChange}
                            required
                            style={styles.input}
                        />
                    </div>
                    <button type="submit" style={styles.button}>Get Transactions</button>
                </form>
            )}
            {message && <p style={{ color: 'red' }}>{message}</p>}
            {transactions.length > 0 && (
                <div>
                    <h3>Transactions</h3>
                    <table style={styles.table}>
                        <thead>
                            <tr>
                                <th style={styles.th}>Date</th>
                                <th style={styles.th}>Type</th>
                                <th style={styles.th}>Amount</th>
                            </tr>
                        </thead>
                        <tbody>
                            {transactions.map(transaction => (
                                <tr key={transaction.id}>
                                    <td style={styles.td}>{transaction.date}</td>
                                    <td style={styles.td}>{transaction.type}</td>
                                    <td style={styles.td}>${transaction.amount}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
}

const styles = {
    container: {
        padding: '20px',
    },
    form: {
        marginBottom: '15px',
    },
    formGroup: {
        marginBottom: '15px',
    },
    input: {
        width: '100%',
        padding: '10px',
        marginBottom: '10px',
        border: '1px solid #ccc',
        borderRadius: '4px',
        fontFamily: 'Arial, sans-serif',
        boxSizing: 'border-box',
    },
    button: {
        padding: '10px',
        backgroundColor: '#007bff',
        color: 'white',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
        fontFamily: 'Arial, sans-serif',
        transition: 'background-color 0.3s ease',
    },
    buttonHover: {
        backgroundColor: '#0056b3',
    },
    table: {
        width: '100%',
        borderCollapse: 'collapse',
    },
    th: {
        border: '1px solid #ccc',
        padding: '10px',
        background: '#f9f9f9',
    },
    td: {
        border: '1px solid #ccc',
        padding: '10px',
    },
};
